    {"name": "Intel Corporation", "symbol": "INTL", "lastPrice": 36.16, "change": -0.370000000000005, "high": 36.78, "low": 36.125, "open": 36.58}
  ]
class Stocks extends React.Component {
//   console.log(props.stocklist && props.stocklist.name);


     render(){   

  return (
    <div>
      <p>{stocklist.map(stocklist => (<Stocks stocklist={stocklist} key={stocklist.name} />))}</p>

    </div>
  );
     }
}

export default Stocks;
